(1, 'change_request_alert_email', 'Change Request: {WEBSITE_NAME}', 'Dear {TO_NAME},<br>\r\n<br>\r\nA change request has been submitted by {NAME} for the website {WEBSITE_LINK}.<br><br>\r\nChange request details:<br><br>\r\n{REQUEST}<br/>\r\n', 'a:6:{s:7:\"to_name\";s:14:\"Recipient name\";s:9:\"from_name\";s:13:\"Uploader name\";s:12:\"website_name\";s:15:\"Name of website\";s:12:\"website_link\";s:15:\"Link to website\";s:4:\"name\";s:19:\"Change request name\";s:7:\"request\";s:19:\"Change request text\";}', '1', 0, NULL, '2015-12-17', NULL),
(2, 'customer_signup_thank_you_page', 'Displayed after a customer signs up.', '<h2>Thank You</h2>\r\n    <p>Thank you. Your  request has been submitted successfully.</p>\r\n    <p>Please check your email.</p>\r\n    ', 'a:0:{}', '0', 0, NULL, '2015-12-16', NULL),
(3, 'customer_signup_email_welcome', 'Welcome {CUSTOMER_NAME}', 'Dear {CUSTOMER_NAME},<br>\r\n<br>\r\nThank you for completing the information form on our website. We will be in touch shortly.<br><br>\r\nKind Regards,<br><br>\r\n{FROM_NAME}\r\n', 'a:0:{}', '1', 0, NULL, '2015-12-16', NULL),
(4, 'customer_signup_email_admin', 'New Customer Signup: {CUSTOMER_NAME}', 'Dear Admin,<br>\r\n<br>\r\nA customer has signed up in the system!<br><br>\r\nView/Edit this customer by going here: {CUSTOMER_NAME_LINK}<br><br>\r\nWebsite: {WEBSITE_NAME_LINK}<br><br>\r\nJobs: {JOB_LINKS}<br><br>\r\nNotes: {NOTES}<br><br>\r\n{UPLOADED_FILES}<br><br>\r\n{SYSTEM_NOTE}\r\n', 'a:0:{}', '1', 0, NULL, '2015-12-16', NULL),
(5, 'customer_signup_form_wrapper', 'Customer Signup Form', '<p>{SIGNUP_FORM}</p>', 'a:1:{s:11:\"SIGNUP_FORM\";s:33:\"<style type=\"text/css\">\n#ucmsi...\";}', '1', 0, 1, '2015-12-16', '2018-08-19'),
(6, 'faq_item', 'Used when displaying an individual FAQ item to the public.', '\r\n<a href=\"{FAQ_BACK}\" class=\"faq_back\">&laquo; Return to FAQ Database</a>\r\n<h2>{QUESTION}</h2>\r\n{ANSWER}<br/>\r\n', 'a:0:{}', '0', 0, NULL, '2015-12-16', NULL),
(7, 'faq_list', 'Used when displaying the list of FAQ items to the public.', '\r\n<h2>FAQ Database</h2>\r\n{LISTING}<br/>\r\n', 'a:0:{}', '0', 0, NULL, '2015-12-16', NULL),
(8, 'file_upload_alert_email', 'File Updated: {FILE_NAME} {CUSTOMER_NAME}', 'Dear {TO_NAME},<br>\r\n<br>\r\nA file has been uploaded/updated by {FROM_NAME} called {FILE_NAME}.<br><br>\r\nView this file by going here: {FILE_LINK}<br><br>\r\nCustomer: {CUSTOMER_NAME}<br/>\r\nDescription: {DESCRIPTION}\r\n', 'a:34:{s:7:\"FILE_ID\";s:1:\"1\";s:11:\"CUSTOMER_ID\";s:3:\"111\";s:6:\"JOB_ID\";s:1:\"0\";s:8:\"QUOTE_ID\";N;s:8:\"OWNER_ID\";N;s:11:\"OWNER_TABLE\";N;s:9:\"FILE_PATH\";s:33:\"includes/plugin_file/upload/15...\";s:8:\"FILE_URL\";s:0:\"\";s:9:\"FILE_NAME\";s:5:\"1.jpg\";s:9:\"FILE_TIME\";s:10:\"1517364376\";s:6:\"STATUS\";s:8:\"Uploaded\";s:6:\"BUCKET\";s:1:\"0\";s:21:\"BUCKET_PARENT_FILE_ID\";s:1:\"0\";s:13:\"APPROVED_TIME\";s:1:\"0\";s:11:\"APPROVED_BY\";s:1:\"0\";s:8:\"POINTERS\";N;s:11:\"DESCRIPTION\";s:10:\"File notes\";s:12:\"DATE_CREATED\";s:19:\"2018-01-31 03:06:16\";s:12:\"DATE_UPDATED\";N;s:14:\"CREATE_USER_ID\";s:1:\"1\";s:14:\"UPDATE_USER_ID\";N;s:17:\"CREATE_IP_ADDRESS\";s:9:\"127.0.0.1\";s:17:\"UPDATE_IP_ADDRESS\";N;s:11:\"TRAINING_ID\";s:1:\"0\";s:9:\"REFUND_ID\";s:1:\"0\";s:8:\"FILE_NOM\";s:0:\"\";s:9:\"TYPOLOGIE\";s:3:\"CFP\";s:4:\"TYPE\";s:6:\"upload\";s:13:\"CUSTOMER_NAME\";s:13:\"Customer Name\";s:13:\"CUSTOMER_LINK\";s:33:\"http://dev-crm.form-alliance.f...\";s:9:\"FILE_LINK\";s:12:\"Link to file\";s:3:\"NEW\";b:1;s:7:\"TO_NAME\";s:14:\"Recipient name\";s:9:\"FROM_NAME\";s:13:\"Uploader name\";}', '1', 0, 1, '2015-12-16', '2019-04-17'),
(9, 'file_comment_alert_email', 'File Comment: {FILE_NAME} {CUSTOMER_NAME}', 'Dear {TO_NAME},<br>\r\n<br>\r\nA file has been commented on by {FROM_NAME} called {FILE_NAME}.<br><br>\r\nView this file by going here: {FILE_LINK}<br><br>\r\nCustomer: {CUSTOMER_NAME}<br/>\r\nComment: {COMMENT}\r\n', 'a:37:{s:7:\"FILE_ID\";s:3:\"648\";s:11:\"CUSTOMER_ID\";s:4:\"1264\";s:6:\"JOB_ID\";s:1:\"0\";s:8:\"QUOTE_ID\";N;s:8:\"OWNER_ID\";N;s:11:\"OWNER_TABLE\";N;s:9:\"FILE_PATH\";s:33:\"includes/plugin_file/upload/15...\";s:8:\"FILE_URL\";s:0:\"\";s:9:\"FILE_NAME\";s:9:\"image.jpg\";s:9:\"FILE_TIME\";s:10:\"1537974013\";s:6:\"STATUS\";s:8:\"Uploaded\";s:6:\"BUCKET\";s:1:\"0\";s:21:\"BUCKET_PARENT_FILE_ID\";s:1:\"0\";s:13:\"APPROVED_TIME\";s:1:\"0\";s:11:\"APPROVED_BY\";s:1:\"0\";s:8:\"POINTERS\";s:0:\"\";s:11:\"DESCRIPTION\";s:0:\"\";s:12:\"DATE_CREATED\";s:19:\"2018-09-26 17:00:13\";s:12:\"DATE_UPDATED\";s:19:\"2018-09-26 17:01:48\";s:14:\"CREATE_USER_ID\";s:4:\"2030\";s:14:\"UPDATE_USER_ID\";s:4:\"2030\";s:17:\"CREATE_IP_ADDRESS\";s:12:\"90.57.103.69\";s:17:\"UPDATE_IP_ADDRESS\";s:12:\"90.57.103.69\";s:11:\"TRAINING_ID\";s:1:\"0\";s:9:\"REFUND_ID\";s:1:\"0\";s:8:\"FILE_NOM\";s:0:\"\";s:9:\"TYPOLOGIE\";s:3:\"CFP\";s:4:\"TYPE\";s:6:\"upload\";s:7:\"COMMENT\";s:4:\"Gpeg\";s:13:\"CUSTOMER_NAME\";s:30:\"LES HOPITAUX DU BASSIN DE THAU\";s:13:\"CUSTOMER_LINK\";s:33:\"http://w.centre-fao.fr/?m[0]=c...\";s:9:\"FILE_LINK\";s:33:\"http://w.centre-fao.fr/?m[0]=c...\";s:7:\"to_name\";s:14:\"Recipient name\";s:9:\"from_name\";s:13:\"Uploader name\";s:9:\"file_link\";s:12:\"Link to file\";s:13:\"customer_name\";s:13:\"Customer Name\";s:7:\"comment\";s:12:\"File comment\";}', '1', 0, 1113, '2015-12-16', '2018-11-16'),
(10, 'job_task_completion_email', 'Job Task Completed: {JOB_NAME}.', '<h2>Job Task Completed</h2>\r\nWe thought you would like to know that your job <strong>{JOB_NAME}</strong> task <strong>{TASK_DESCRIPTION}</strong> has been completed.\r\n', 'a:0:{}', '0', 0, NULL, '2015-12-16', NULL),
(11, 'job_staff_email', 'Assigned Job Tasks: {JOB_NAME}', 'Dear {STAFF_NAME},<br>\r\n<br>\r\nPlease find below your {TASK_COUNT} assigned tasks for job: {JOB_NAME}.<br><br>\r\nYou can view this job by <a href=\"{JOB_URL}\">clicking here</a>.<br><br>\r\n{JOB_TASKS}<br><br>\r\nThank you,<br><br>\r\n{FROM_NAME}\r\n', 'a:5:{s:10:\"STAFF_NAME\";s:14:\"Customers Name\";s:8:\"JOB_NAME\";s:8:\"Job Name\";s:10:\"TASK_COUNT\";s:24:\"Number of assigned tasks\";s:7:\"JOB_URL\";s:24:\"Link to job for customer\";s:9:\"JOB_TASKS\";s:41:\"Output of job tasks for this staff member\";}', '1', 0, NULL, '2015-12-16', NULL),
