(13, 'job_discussion_email_customer', 'New Job Comment: {JOB_NAME}', 'Dear {CUSTOMER_NAME},<br>\r\n<br>\r\nA new comment has been added to a task in your job: {JOB_NAME}.<br><br>\r\nTask: {TASK_NAME} <br/><br/>\r\nNote: {NOTE}<br/><br/>\r\nYou can view this job and the comments online by <a href=\"{JOB_URL}\">clicking here</a>.<br><br>\r\nThank you,<br><br>\r\n{FROM_NAME}\r\n', 'a:6:{s:13:\"CUSTOMER_NAME\";s:14:\"Customers Name\";s:8:\"JOB_NAME\";s:8:\"Job Name\";s:9:\"FROM_NAME\";s:9:\"Your name\";s:7:\"JOB_URL\";s:24:\"Link to job for customer\";s:9:\"TASK_NAME\";s:38:\"name of the task the note was added to\";s:4:\"NOTE\";s:16:\"Copy of the note\";}', '1', 0, NULL, '2015-12-16', NULL),
(14, 'job_discussion_email_staff', 'New Comment on your Job: {JOB_NAME}', 'Dear {STAFF_NAME},<br>\r\n<br>\r\nA new comment has been added to a task in your job: {JOB_NAME}.<br><br>\r\nTask: {TASK_NAME} <br/><br/>\r\nNote: {NOTE}<br/><br/>\r\nYou can view this job and the comments online by <a href=\"{JOB_URL}\">clicking here</a>.<br><br>\r\nThank you,<br><br>\r\n{FROM_NAME}\r\n', 'a:6:{s:10:\"STAFF_NAME\";s:10:\"Staff Name\";s:8:\"JOB_NAME\";s:8:\"Job Name\";s:9:\"FROM_NAME\";s:9:\"Your name\";s:7:\"JOB_URL\";s:28:\"Link to job for staff member\";s:9:\"TASK_NAME\";s:38:\"name of the task the note was added to\";s:4:\"NOTE\";s:16:\"Copy of the note\";}', '1', 0, NULL, '2015-12-16', NULL),
