(27, 'ticket_admin_email', 'Sent as an email to the administrator when a new ticket is created.', '{MESSAGE}<br />\r\n<br />\r\n<br />\r\n<span style=\"font-size:12px; color:#666666; font-weight: bold;\">Ticket Details:</span><br />\r\n<span style=\"font-size:10px; color:#666666;\">Number of messages: <strong>{MESSAGE_COUNT}</strong></span><br />\r\n<span style=\"font-size:10px; color:#666666;\">Ticket Number: <strong>{TICKET_NUMBER}</strong></span><br />\r\n<span style=\"font-size:10px; color:#666666;\">Ticket Status: <strong>{TICKET_STATUS}</strong></span><br />\r\n<span style=\"font-size:10px; color:#666666;\">Position in the support queue: <strong>{POSITION_CURRENT} out of {POSITION_ALL}</strong>.</span><br />\r\n<span style=\"font-size:10px; color:#666666;\">Estimated time for a reply: <strong>within {DAYS} days</strong></span><br />\r\n<span style=\"font-size:10px; color:#666666;\">View the ticket: <strong>{URL_ADMIN}</strong></span><br />\r\n        ', 'a:0:{}', '1', 0, NULL, '2015-12-16', NULL),
(28, 'ticket_autoreply', 'Sent as an email after a support ticket is received.', 'Hello,<br />\r\n<br />\r\nThank you for your email. We will reply shortly.<br />\r\n<br />\r\n        ', 'a:0:{}', '1', 0, NULL, '2015-12-16', NULL),
(29, 'ticket_rejection', 'Email Bounced: {SUBJECT}.', 'Hello,<br />\r\n<br />\r\nPlease submit all NEW support tickets via our website by following this link:<br />\r\n{TICKET_URL}<br />\r\n<br />\r\nNew support tickets are no longer accepted via email due to high levels of spam causing delays for everyone.<br />\r\n<br />\r\nThanks,<br />\r\n<br />\r\n        ', 'a:0:{}', '1', 0, NULL, '2015-12-16', NULL),
(30, 'member_subscription_form', 'Used when a user wishes to subscribe.', '<h2>Subscribe</h2>\r\n<form action=\"\" method=\"post\">\r\n    <p>Please Enter Your Email Address: <input type=\"text\" name=\"member[email]\" value=\"{EMAIL}\"> </p>\r\n    <p>Please Enter Your First Name: <input type=\"text\" name=\"member[first_name]\" value=\"{FIRST_NAME}\"> </p>\r\n    <p>Please Enter Your Last Name: <input type=\"text\" name=\"member[last_name]\" value=\"{LAST_NAME}\"> </p>\r\n    <p>Please Enter Your Business Name: <input type=\"text\" name=\"member[business]\" value=\"{BUSINESS}\"> </p>\r\n    <p>Please Enter Your Phone Number: <input type=\"text\" name=\"member[phone]\" value=\"{PHONE}\"> </p>\r\n    <p>\r\n    Please choose your newsletter subscription options: <br/>\r\n    {NEWSLETTER_OPTIONS}\r\n    </p>\r\n    <p><input type=\"submit\" name=\"confirm\" value=\"Subscribe\"></p>\r\n</form>\r\n    ', 'a:0:{}', '0', 0, NULL, '2015-12-16', NULL),
(31, 'member_subscription_error', 'Displayed when subscription fails (eg: missing email address).', '<h2>Subscription Error</h2>\r\n    <p>Sorry there was an error when processing your request:</p>\r\n    <p>{MESSAGE}</p>\r\n    ', 'a:1:{s:7:\"MESSAGE\";s:19:\"Message to the user\";}', '0', 0, NULL, '2015-12-16', NULL),
(32, 'member_subscription_success', 'Displayed when subscription is successful.', '<h2>Subscription Success</h2>\r\n    <p>Thank you, subscription successful.</p>\r\n    <p>A message has been sent to your email address ({EMAIL}) to confirm your newsletter subscription.</p>\r\n    ', 'a:1:{s:5:\"EMAIL\";s:19:\"Users email address\";}', '0', 0, NULL, '2015-12-16', NULL),
(33, 'member_update_details_success', 'Displayed when updating details is successful.', '<h2>Subscription Success</h2>\r\n    <p>Thank you, subscription details updated.</p>\r\n    <p>Your email address: ({EMAIL})</p>\r\n    ', 'a:1:{s:5:\"EMAIL\";s:19:\"Users email address\";}', '0', 0, NULL, '2015-12-16', NULL),
(34, 'password_reset', 'Reset your password', 'Dear {NAME},<br>\r\n    <br>\r\n    Please click the link below to login and reset your password.<br><br>\r\n    <a href=\"{AUTO_LOGIN_URL}\">CLICK HERE</a> <br/><br/>\r\n    Thank you,<br><br>\r\n    {FROM_NAME}\r\n    ', 'a:1:{s:4:\"NAME\";s:10:\"Users Name\";}', '1', 0, NULL, '2015-12-16', '2018-02-18'),
