(37, 'invoice_payment_methods_online_footer', 'Displayed on the invoice.', '{PAYMENT_METHODS}\r\n	        <br/>\r\n	        Please <a href=\"{LINK}\">click here</a> to pay online.\r\n	        ', 'a:2:{s:4:\"LINK\";s:24:\"URL link to invoice page\";s:15:\"PAYMENT_METHODS\";s:33:\"List of supported payment methods\";}', '0', 1, NULL, '2015-12-16', NULL),
