(39, 'invoice_payment_in_full', 'Displayed on the external invoice.', 'Invoice has been paid in full. <br/><br/>\r\n	        Thank you for your business.\r\n	        ', 'a:0:{}', '0', 1, NULL, '2015-12-16', NULL),
(40, 'invoice_payment_pending', 'Displayed when a user has an automatic payment pending on an invoice.', 'Automatic Invoice Payment Pending. <br/><br/>\r\n	        Thank you for your business.\r\n	        ', 'a:0:{}', '0', 1, NULL, '2015-12-16', NULL),
(41, 'invoice_payment_thankyou', 'This page is displayed after a payment is made on an invoice.', '<h2>Invoice Payment</h2>\r\n	<p>Invoice Number: <strong>{INVOICE_NUMBER}</strong> </p>\r\n	<p>Thank you for making payment on this Invoice. We will email you a receipt shortly.</p>\r\n	', 'a:0:{}', '0', 1, NULL, '2015-12-16', NULL),
(42, 'invoice_payment_subscription', 'Used when a customer tries to pay an invoice that has a subscription option.', '<h2>Payment for Invoice {INVOICE_NUMBER}</h2>\r\n<p>Please choose from the available payment options below:</p>\r\n<form action=\"{PAYMENT_URL}\" method=\"post\">\r\n<input type=\"hidden\" name=\"invoice_payment_id\" value=\"{INVOICE_PAYMENT_ID}\">\r\n<input type=\"hidden\" name=\"payment_method\" value=\"{PAYMENT_METHOD}\">\r\n<input type=\"hidden\" name=\"payment_amount\" value=\"{PAYMENT_AMOUNT}\">\r\n<p><input type=\"submit\" name=\"payment_single\" value=\"Pay a Once Off amount of {PRETTY_PAYMENT_AMOUNT}\"></p>\r\n<p><input type=\"submit\" name=\"payment_subscription\" value=\"Setup Automatic Payments of {PRETTY_PAYMENT_AMOUNT} every {SUBSCRIPTION_PERIOD}\"></p>\r\n</form>\r\n', 'a:0:{}', '0', 1, NULL, '2015-12-16', NULL),
(43, 'invoice_email_due', 'Invoice Owing: {INVOICE_NUMBER}', 'Dear {CUSTOMER_NAME},<br>\r\n<br>\r\nPlease find attached your invoice {INVOICE_NUMBER}.<br><br>\r\nThe {TOTAL_AMOUNT} is due on {DATE_DUE}.<br><br>\r\nYou can also view this invoice online by <a href=\"{INVOICE_URL}\">clicking here</a>.<br><br>\r\nThank you,<br><br>\r\n{FROM_NAME}\r\n', 'a:6:{s:13:\"CUSTOMER_NAME\";s:14:\"Customers Name\";s:14:\"INVOICE_NUMBER\";s:14:\"Invoice Number\";s:12:\"TOTAL_AMOUNT\";s:23:\"Total amount of invoice\";s:8:\"DATE_DUE\";s:8:\"Due Date\";s:9:\"FROM_NAME\";s:9:\"Your name\";s:11:\"INVOICE_URL\";s:28:\"Link to invoice for customer\";}', '1', 1, NULL, '2015-12-16', NULL),
(44, 'credit_note_email', 'Credit Note: {INVOICE_NUMBER}', 'Dear {CUSTOMER_NAME},<br>\r\n<br>\r\nPlease find attached your Credit Note {INVOICE_NUMBER} for Invoice {CREDIT_INVOICE_NUMBER}.<br><br>\r\nTotal amount: {TOTAL_AMOUNT}<br><br>\r\nYou can view this invoice online by <a href=\"{INVOICE_URL}\">clicking here</a>.<br><br>\r\nThank you,<br><br>\r\n{FROM_NAME}\r\n', 'a:9:{s:13:\"CUSTOMER_NAME\";s:14:\"Customers Name\";s:26:\"INVOICE_FOURNISSEUR_NUMBER\";s:18:\"Credit Note Number\";s:33:\"CREDIT_INVOICE_FOURNISSEUR_NUMBER\";s:33:\"Original Invoice_fournisseur N...\";s:12:\"TOTAL_AMOUNT\";s:23:\"Total amount of invoice\";s:9:\"FROM_NAME\";s:9:\"Your name\";s:23:\"INVOICE_FOURNISSEUR_URL\";s:33:\"Link to invoice_fournisseur fo...\";s:14:\"INVOICE_NUMBER\";s:18:\"Credit Note Number\";s:21:\"CREDIT_INVOICE_NUMBER\";s:23:\"Original Invoice Number\";s:11:\"INVOICE_URL\";s:28:\"Link to invoice for customer\";}', '1', 1, 1, '2015-12-16', '2019-10-11'),
(45, 'invoice_email_overdue', 'Invoice Overdue: {INVOICE_NUMBER}', 'Dear {CUSTOMER_NAME},<br>\r\n<br>\r\nThe attached invoice {INVOICE_NUMBER} is now <span style=\"font-weight:bold; color:#FF0000;\">overdue</span>.<br><br>\r\nThe {TOTAL_AMOUNT} was due on {DATE_DUE}.<br><br>\r\nYou can also view this invoice online by <a href=\"{INVOICE_URL}\">clicking here</a>.<br><br>\r\nThank you,<br><br>\r\n{FROM_NAME}\r\n', 'a:6:{s:13:\"CUSTOMER_NAME\";s:14:\"Customers Name\";s:14:\"INVOICE_NUMBER\";s:14:\"Invoice Number\";s:12:\"TOTAL_AMOUNT\";s:23:\"Total amount of invoice\";s:8:\"DATE_DUE\";s:8:\"Due Date\";s:9:\"FROM_NAME\";s:9:\"Your name\";s:11:\"INVOICE_URL\";s:28:\"Link to invoice for customer\";}', '1', 1, NULL, '2015-12-16', NULL),
(46, 'invoice_email_paid', 'Invoice Paid: {INVOICE_NUMBER}', 'Dear {CUSTOMER_NAME},<br>\r\n<br>\r\nThank you for your {TOTAL_AMOUNT} payment on invoice {INVOICE_NUMBER}.<br><br>\r\nThis invoice was paid in full on {DATE_PAID}.<br><br>\r\nPlease find attached the receipt for this invoice payment. <br>\r\nYou can also view this invoice online by <a href=\"{INVOICE_URL}\">clicking here</a>.<br><br>\r\nThank you,<br><br>\r\n{FROM_NAME}\r\n', 'a:6:{s:13:\"CUSTOMER_NAME\";s:14:\"Customers Name\";s:14:\"INVOICE_NUMBER\";s:14:\"Invoice Number\";s:12:\"TOTAL_AMOUNT\";s:23:\"Total amount of invoice\";s:9:\"DATE_PAID\";s:9:\"Paid date\";s:9:\"FROM_NAME\";s:9:\"Your name\";s:11:\"INVOICE_URL\";s:28:\"Link to invoice for customer\";}', '1', 1, 1, '2015-12-16', '2016-10-19'),
