(48, 'quote_pdf', 'Used for printing out an quote for the customer.', '<html>\r\n<head>\r\n<title>Quote</title>\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\r\n<style type=\"text/css\">\r\nbody{\r\nfont-family:Helvetica, sans-serif;\r\npadding:0;\r\nmargin:0;\r\n}\r\ntd{\r\nfont-family:Helvetica, sans-serif;\r\npadding:2px;\r\n}\r\nh3{\r\nfont-size: 22px;\r\nfont-weight: bold;\r\nmargin:10px 0 10px 0;\r\npadding:0 0 5px 0;\r\nborder-bottom:1px solid #6f6f6f;\r\nwidth:100%;\r\n}\r\n.style11 {\r\nfont-size: 24px;\r\nfont-weight: bold;\r\nmargin:0;\r\npadding:0;\r\n}\r\n.task_header,\r\n.task_header th{\r\nbackground-color:#e8e8e8;\r\ncolor: #6f6f6f;\r\nfont-weight: bold;\r\n}\r\ntr.odd{\r\nbackground-color:#f9f9f9;\r\n}\r\n</style>\r\n</head>\r\n<body>\r\n<table style=\"width: 100%;\" border=\"0\" cellspacing=\"0\" cellpadding=\"1\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\" align=\"left\" valign=\"top\"><img title=\"Logo\" src=\"http://ultimateclientmanager.com/images/logo_ucm.png\" alt=\"Logo\" width=\"202\" height=\"60\" /></td>\r\n<td colspan=\"2\" align=\"left\" valign=\"top\"><span class=\"style11\">QUOTE</span></td>\r\n</tr>\r\n<tr>\r\n<td width=\"12%\">&nbsp;</td>\r\n<td width=\"43%\">&nbsp;</td>\r\n<td width=\"14%\">&nbsp;</td>\r\n<td width=\"31%\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td><strong>ABN:</strong></td>\r\n<td>12 345 678 912</td>\r\n<td><strong>Quote No: <br /> </strong></td>\r\n<td>{QUOTE_NUMBER}</td>\r\n</tr>\r\n<tr>\r\n<td><strong>Email: </strong></td>\r\n<td>your@company.com</td>\r\n<td><strong>Issued Date:</strong></td>\r\n<td>{DATE_CREATE}</td>\r\n</tr>\r\n<tr>\r\n<td><strong>Web: </strong></td>\r\n<td>www.company.com</td>\r\n<td><strong>Valid Until:</strong></td>\r\n<td>{DATE_CREATE+30d}</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3>RECIPIENT</h3>\r\n<table style=\"width: 100%;\" border=\"0\" cellspacing=\"0\" cellpadding=\"1\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" width=\"12%\"><strong>Company:</strong></td>\r\n<td valign=\"top\" width=\"43%\">{CUSTOMER_NAME}</td>\r\n<td valign=\"top\" width=\"14%\"><strong>Email:</strong></td>\r\n<td valign=\"top\" width=\"31%\">{CONTACT_EMAIL}</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\"><strong>Contact:</strong></td>\r\n<td valign=\"top\">{CONTACT_NAME}</td>\r\n<td valign=\"top\"><strong>{PROJECT_TYPE}:</strong>&nbsp;</td>\r\n<td valign=\"top\">{PROJECT_NAME}&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\"><strong>Phone:</strong></td>\r\n<td valign=\"top\">{CONTACT_PHONE}</td>\r\n<td valign=\"top\">&nbsp;</td>\r\n<td valign=\"top\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3>QUOTE DETAILS</h3>\r\n<div>{TASK_LIST}</div>\r\n<p>&nbsp;</p>\r\n<h3>QUOTE APPROVAL</h3>\r\n<p>{if:DATE_APPROVED}Thank you, this Quote was approved by <strong>{APPROVED_BY}</strong> on <strong>{DATE_APPROVED}</strong>{else} If you are happy with this quote please click the buttom below to process approval.</p>\r\n<p><a href=\"{QUOTE_LINK}\">Approve This Quote</a>{endif:DATE_APPROVED}</p>\r\n</body>\r\n</html>', 'a:131:{s:12:\"QUOTE_NUMBER\";s:4:\"test\";s:10:\"QUOTE_NAME\";s:4:\"test\";s:12:\"PROJECT_TYPE\";s:7:\"Website\";s:10:\"PRINT_LINK\";s:33:\"http://ceramica.beletross.com/...\";s:9:\"QUOTE_URL\";s:33:\"http://ceramica.beletross.com/...\";s:5:\"TITLE\";s:8:\"CERAMICA\";s:11:\"CREATE_DATE\";s:10:\"27/05/2019\";s:11:\"CUSTOMER_ID\";s:1:\"2\";s:16:\"CUSTOMER_TYPE_ID\";s:1:\"0\";s:15:\"PRIMARY_USER_ID\";s:1:\"3\";s:15:\"CUSTOMER_STATUS\";s:1:\"0\";s:13:\"CUSTOMER_NAME\";s:4:\"Test\";s:6:\"CREDIT\";s:4:\"0.00\";s:11:\"DEFAULT_TAX\";s:5:\"-1.00\";s:16:\"DEFAULT_TAX_NAME\";s:0:\"\";s:22:\"DEFAULT_INVOICE_PREFIX\";s:0:\"\";s:4:\"TYPE\";s:7:\"Cuisine\";s:12:\"DATE_CREATED\";s:10:\"11/06/2019\";s:12:\"DATE_UPDATED\";s:10:\"11/06/2019\";s:5:\"SIREN\";s:0:\"\";s:8:\"CODE_NAF\";s:0:\"\";s:14:\"RAISON_SOCIALE\";s:0:\"\";s:10:\"PARRAIN_ID\";s:1:\"0\";s:11:\"NUM_DOSSIER\";s:1:\"2\";s:13:\"DATE_CREATION\";N;s:6:\"TAMPON\";N;s:7:\"DIPLOM