(53, 'invoice_print', 'Used for printing out an invoice for the customer.', '<html>\n<head>\n<title>Invoice</title>\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n<style type=\"text/css\">\nbody{\nfont-family:Helvetica, sans-serif;\npadding:0;\nmargin:0;\n}\ntd{\nfont-family:Helvetica, sans-serif;\npadding:2px;\n}\nh3{\nfont-size: 22px;\nfont-weight: bold;\nmargin:10px 0 10px 0;\npadding:0 0 5px 0;\nborder-bottom:1px solid #6f6f6f;\nwidth:100%;\n}\n.style11 {\nfont-size: 24px;\nfont-weight: bold;\nmargin:0;\npadding:0;\n}\n.task_header,\n.task_header th{\nbackground-color:#e8e8e8;\ncolor: #6f6f6f;\nfont-weight: bold;\n}\ntr.odd{\nbackground-color:#f9f9f9;\n}\n</style>\n</head>\n<body>\n<table style=\"width: 100%;\" border=\"0\" cellspacing=\"0\" cellpadding=\"1\" align=\"center\">\n<tbody>\n<tr>\n<td colspan=\"2\" align=\"left\" valign=\"top\"><img title=\"Logo\" src=\"http://ultimateclientmanager.com/images/logo_ucm.png\" alt=\"Logo\" width=\"202\" height=\"60\" /></td>\n<td colspan=\"2\" align=\"left\" valign=\"top\"><span class=\"style11\">TAX INVOICE</span>\n<p>{if:IS_INVOICE_PAID}<span style=\"font-size: 1.6em;\"><strong>INVOICE PAID</strong></span>{endif:IS_INVOICE_PAID}</p>\n</td>\n</tr>\n<tr>\n<td width=\"12%\">&nbsp;</td>\n<td width=\"43%\">&nbsp;</td>\n<td width=\"14%\"><strong>Invoice No:</strong></td>\n<td width=\"31%\">{INVOICE_NUMBER}</td>\n</tr>\n<tr>\n<td width=\"12%\"><strong>ABN:</strong></td>\n<td width=\"43%\">12 345 678 912</td>\n<td><strong>Invoice Date:</strong></td>\n<td>{DATE_CREATE}</td>\n</tr>\n<tr>\n<td><strong>Email: </strong></td>\n<td>your@company.com</td>\n<td><strong>Due Date:</strong></td>\n<td>{DATE_DUE}</td>\n</tr>\n<tr>\n<td><strong>Web: </strong></td>\n<td>www.company.com</td>\n<td><strong>Paid Date:</strong></td>\n<td>{DATE_PAID}</td>\n</tr>\n</tbody>\n</table>\n<h3>RECIPIENT</h3>\n<table style=\"width: 100%;\" border=\"0\" cellspacing=\"0\" cellpadding=\"1\" align=\"center\">\n<tbody>\n<tr>\n<td widt