(54, 'invoice_print_basic', 'Alternative template for printing out an invoice for the customer.', '<html>\n<head>\n    <title>Invoice</title>\n    <style>\n        *\n        {\n            margin:0;\n            padding:0;\n            font-family:Arial;\n            font-size:10pt;\n            color:#000;\n        }\n        body\n        {\n            width:100%;\n            font-family:Arial;\n            font-size:10pt;\n            margin:0;\n            padding:0;\n        }\n\n        p\n        {\n            margin:0;\n            padding:0;\n        }\n\n        #wrapper\n        {\n            width:auto;\n            margin:0 15mm;\n        }\n\n        .page\n        {\n            page-break-after:always;\n        }\n\n        table\n        {\n            border-left: 1px solid #ccc;\n            border-top: 1px solid #ccc;\n	        width:100%;\n            border-spacing:0;\n            border-collapse: collapse;\n\n        }\n\n        table td\n        {\n            border-right: 1px solid #ccc;\n            border-bottom: 1px solid #ccc;\n            padding: 2mm;\n        }\n\n        table.heading\n        {\n            height:50mm;\n        }\n\n        h1.heading\n        {\n            font-size:14pt;\n            color:#000;\n            font-weight:normal;\n        }\n\n        h2.heading\n        {\n            font-size:9pt;\n            color:#000;\n            font-weight:normal;\n        }\n\n        hr\n        {\n            color:#ccc;\n            background:#ccc;\n        }\n\n        #invoice_body\n        {\n        }\n\n        #invoice_body , #invoice_total\n        {\n            width:100%;\n        }\n        #invoice_body table , #invoice_total table\n        {\n            width:100%;\n            border-left: 1px solid #ccc;\n            border-top: 1px solid #ccc;\n\n            border-spacing:0;\n            border-collapse: collapse;\n\n            margin-top:5mm;\n        }\n\n        #invoice_body table td , #invoice_total table td\n        {\n            text-align:center;\n            font-size:9pt;\n            border-right: 1px solid #ccc;\n            border-bottom: 1px solid #ccc;\n            padding:2mm 0;\n        }\n\n        #invoice_body table td.mono  , #invoice_total table td.mono\n        {\n            font-family:monospace;\n            text-align:right;\n            padding-right:3mm;\n            font-size:10pt;\n        }\n\n        #footer\n        {\n            width:auto;\n            margin:0 15mm;\n            padding-bottom:3mm;\n        }\n        #footer table\n        {\n            width:100%;\n            border-left: 1px solid #ccc;\n            border-top: 1px solid #ccc;\n\n            background:#eee;\n\n            border-spacing:0;\n            border-collapse: collapse;\n        }\n        #footer table td\n        {\n            width:25%;\n            text-align:center;\n            font-size:9pt;\n            border-right: 1px solid #ccc;\n            border-bottom: 1px solid #ccc;\n        }\n    </style>\n</head>\n<body>\n<div id=\"wrapper\">\n\n    <p style=\"text-align:center; font-weight:bold; padding-top:5mm;\">TAX INVOICE</p>\n    <br />\n    <table class=\"heading\" style=\"width:100%;\">\n        <tr>\n            <td style=\"width:80mm;\">\n                <h1 class=\"heading\">Your Company Here</h1>\n                <h2 class=\"heading\">\n                    Your Address Here<br />\n                    Your Address Here<br />\n                    Your Address Here<br />\n\n                    Website : www.website.com<br />\n                    E-mail : info@website.com<br />\n                    Phone : +1 - 123456789\n                </h2>\n            </td>\n            <td rowspan=\"2\" valign=\"top\" align=\"right\" style=\"padding:3mm;\">\n                <table>\n                    <tr><td>Invoice No : </td><td>{INVOICE_NUMBER}</td></tr>\n                    <tr><td>Invoice Date : </td><td>{DATE_CREATE}</td></tr>\n                    <tr><td>Due Date : </td><td>{DATE_DUE}</td></tr>\n                    <tr><td>Paid Date : </td><td>{DATE_PAID}</td></tr>\n                </table>\n            </td>\n        </tr>\n        <tr>\n            <td>\n                <b>Buyer</b> :<br />\n                {CUSTOMER_NAME}<br />\n                {CUSTOMER_ADDRESS}<br/>\n	            {CUSTOMER_PHONE}<br/>\n	            {CUSTOMER_EMAIL}\n            </td>\n        </tr>\n    </table>\n\n\n    <div id=\"content\">\n\n        <div id=\"invoice_body\">\n	            {TASK_LIST}\n        </div>\n\n        <table style=\"width:100%; \">\n            <tr>\n                <td valign=\"top\">\n                    {PAYMENT_METHODS}<br/>\n	                {PAYMENT_HISTORY}\n                </td>\n            </tr>\n        </table>\n    </div>\n\n    <br />\n\n    </div>\n\n    <htmlpagefooter name=\"footer\">\n        <hr />\n        <div id=\"footer\">\n            <table>\n                <tr><td>Software Solutions</td><td>Mobile Solutions</td><td>Web Solutions</td></tr>\n            </table>\n        </div>\n    </htmlpagefooter>\n    <sethtmlpagefooter name=\"footer\" value=\"on\" />\n\n</body>\n</html>', 'a:0:{}', '1', 13, NULL, '2016-01-09', NULL),
(55, 'credit_note_pdf', 'Used for printing out a a credit note for the customer.', '<html>\n    <head>\n        <title>Credit Note Print Out</title>\n        <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n        <style type=\"text/css\">\n        body{\n			font-family:arial;\n			font-size:17px;\n		}\n        .table,\n        .table2{\n            border-collapse:collapse;\n        }\n        .table td,\n        .table2 td.border{\n            border:1px solid #EFEFEF;\n            border-collapse:collapse;\n            padding:4px;\n        }\n        .task_header{\n            background-color: #000000;\n            color:#FFFFFF;\n        }\n    </style>\n    </head>\n    <body>\n\n<table width=\"100%\" cellpadding=\"0\" cellspacing=\"0\">\n    <tbody>\n    <tr>\n        <td width=\"10%\">&nbsp;</td>\n        <td width=\"80%\">\n\n\n    <table cellpadding=\"4\" cellspacing=\"0\" width=\"100%\">\n        <tbody>\n            <tr>\n                <td width=\"450\" align=\"left\" valign=\"top\">\n                    <p>\n                        <font style=\"font-size: 1.6em;\">\n                            <strong>Credit Note #:</strong> {INVOICE_NUMBER}<br/>\n                        </font> <br/>\n                        <font style=\"font-size: 1.6em;\">\n                            <strong>Invoice #:</strong> {CREDIT_INVOICE_NUMBER}<br/>\n                        </font> <br/>\n                    </p>\n                </td>\n                <td align=\"right\" valign=\"top\">\n                    <p>\n                        <font style=\"font-size: 1.6em;\"><strong>{TITLE}</strong></font>\n                        <br/>\n                        <font style=\"color: #333333;\">\n                        [our company details]\n                        </font>\n                    </p>\n                </td>\n            </tr>\n            <tr>\n                <td align=\"left\" valign=\"top\">\n                    <strong>INVOICE TO:</strong><br/>\n                    {CUSTOMER_NAME} <br/>\n                    {CUSTOMER_ADDRESS} <br/>\n                    {CONTACT_NAME} {CONTACT_EMAIL} <br/>\n                </td>\n                <td align=\"right\" valign=\"top\">\n                    &nbsp;<br/>\n                    {PROJECT_TYPE}: <strong>{PROJECT_NAME}</strong> <br/>\n                    Job: <strong>{JOB_NAME}</strong>\n                </td>\n            </tr>\n        </tbody>\n    </table>\n    <br/>\n    {TASK_LIST}\n    <br/>\n\n        </td>\n        <td width=\"10%\">&nbsp;</td>\n    </tr>\n    </tbody>\n</table>\n\n\n</body>\n</html>', 'a:0:{}', '1', 13, NULL, '2016-01-09', NULL),
(56, 'invoice_task_list', 'Used when displaying the invoice tasks.', '<table cellpadding=\"4\" cellspacing=\"0\" class=\"table tableclass tableclass_rows\" style=\"width: 100%\" id=\"invoice_task_list\">\n	<thead>\n		<tr class=\"task_header\">\n            <th style=\"width:5%; text-align:center\">\n				#\n			</th>\n			<th  style=\"width:47%; text-align:center\">\n				{l:Description}\n			</th>\n			<th  style=\"width:10%; text-align:center\">\n				{l:Date}\n			</th>\n			<th style=\"width:10%; text-align:center\">\n                {TITLE_QTY_OR_HOURS}\n			</th>\n			<th style=\"width:14%; text-align:center\">\n                {TITLE_AMOUNT_OR_RATE}\n			</th>\n			<th style=\"width:14%; text-align:center\">\n				{l:Sub-Total}\n			</th>\n		</tr>\n	</thead>\n	<tbody>\n        <tr class=\"{ITEM_ODD_OR_EVEN}\" data-item-row=\"true\">\n            <td align=\"center\">\n                {ITEM_NUMBER}\n            </td>\n            <td>\n                {ITEM_DESCRIPTION}\n            </td>\n            <td>\n                {ITEM_DATE}\n            </td>\n            <td align=\"center\">\n                {ITEM_QTY_OR_HOURS}\n            </td>\n            <td style=\"text-align: right;\">\n                {ITEM_AMOUNT_OR_RATE}\n            </td>\n            <td style=\"text-align: right;\">\n                {ITEM_TOTAL}\n            </td>\n        </tr>\n    </tbody>\n    <tfoot>\n        <tr>\n            <td colspan=\"6\">&nbsp;</td>\n        </tr>\n        {INVOICE_SUMMARY}\n    </tfoot>\n</table>\n', 'a:45:{s:5:\"taxes\";a:0:{}s:2:\"ID\";s:1:\"5\";s:15:\"INVOICE_ITEM_ID\";s:1:\"5\";s:10:\"INVOICE_ID\";s:1:\"5\";s:7:\"TASK_ID\";s:2:\"15\";s:5:\"HOURS\";s:4:\"1.00\";s:11:\"HOURLY_RATE\";s:8:\"12000.00\";s:10:\"HOURS_MINS\";i:0;s:6:\"AMOUNT\";s:8:\"12000.00\";s:7:\"TAXABLE\";s:1:\"1\";s:9:\"COMPLETED\";N;s:11:\"DESCRIPTION\";s:7:\"Panneau\";s:16:\"LONG_DESCRIPTION\";s:0:\"\";s:10:\"TASK_ORDER\";s:1:\"1\";s:9:\"DATE_DONE\";s:10:\"2016-01-14\";s:8:\"DATE_DUE\";s:10:\"0000-00