(57, 'invoice_task_list_basic', 'Used when displaying the invoice tasks when invoice_print_basic template is used.', '<table style=\"width: 100%\" id=\"invoice_task_list\">\n    <tr style=\"background:#eee;\">\n        <td style=\"width:8%;\"><b>#</b></td>\n        <td><b>{l:Description}</b></td>\n        <td style=\"width:15%;\"><b>{l:Date}</b></td>\n        <td style=\"width:15%;\"><b>{TITLE_QTY_OR_HOURS}</b></td>\n        <td style=\"width:15%;\"><b>{TITLE_AMOUNT_OR_RATE}</b></td>\n        <td style=\"width:15%;\"><b>{l:Sub-Total}</b></td>\n    </tr>\n</table>\n<table>\n	<tr class=\"{ITEM_ODD_OR_EVEN}\" data-item-row=\"true\">\n        <td style=\"width:8%;\">{ITEM_NUMBER}</td>\n        <td style=\"text-align:left; padding-left:10px;\">{ITEM_DESCRIPTION}</td>\n        <td style=\"width:15%;\">{ITEM_DATE}</td>\n        <td class=\"mono\" style=\"width:15%;\">{ITEM_QTY_OR_HOURS}</td>\n		<td style=\"width:15%;\" class=\"mono\">{ITEM_AMOUNT_OR_RATE}</td>\n        <td style=\"width:15%;\" class=\"mono\">{ITEM_TOTAL}</td>\n    </tr>\n    <tr>\n        <td colspan=\"4\"></td>\n        <td></td>\n        <td></td>\n    </tr>\n    {INVOICE_SUMMARY}\n</table>\n', 'a:0:{}', '0', 13, NULL, '2016-01-09', NULL),
(58, 'invoice_payment_history', 'Used when displaying the invoice payment history.', '		<table cellpadding=\"4\" cellspacing=\"0\" class=\"table tableclass tableclass_rows\" style=\"width: 100%\" id=\"invoice_payment_history\">\n			<thead>\n				<tr class=\"task_header\">\n                    <th>{l:Payment Date}</th>\n                    <th>{l:Payment Method}</th>\n                    <th>{l:Details}</th>\n                    <th>{l:Amount}</th>\n                    <th> </th>\n                </tr>\n            </thead>\n            <tbody>\n                <tr class=\"{ITEM_ODD_OR_EVEN}\" data-item-row=\"true\">\n                    <td>\n                        {ITEM_PAYMENT_DATE}\n                    </td>\n                    <td>\n                        {ITEM_PAYMENT_METHOD}\n                    </td>\n                    <td>\n                        {ITEM_PAYMENT_DETAILS}\n                    </td>\n                    <td>\n                        {ITEM_PAYMENT_AMOUNT}\n                    </td>\n                    <td align=\"center\">\n                        <a href=\"{ITEM_PAYMENT_RECEIPT_URL}\" target=\"_blank\">{l:View Receipt}</a>\n                    </td>\n                </tr>\n            </tbody>\n        </table>\n        ', 'a:2:{s:5:\"TITLE\";s:33:\"<strong>Payment History:</stro...\";s:16:\"ITEM_ROW_CONTENT\";s:33:\"<tr class=\"even\">\n            ...\";}', '0', 16, 109, '2016-01-14', '2016-09-03'),
(59, 'invoice_payment_history_basic', 'Used when displaying the invoice payment history in the basic invoice template.', '		<table id=\"invoice_payment_history\" style=\"width:100%;\">\n			<tr style=\"background:#eee;\">\n                <td>{l:Payment Date}</td>\n                <td>{l:Payment Mathod}</td>\n                <td>{l:Details}</td>\n                <td>{l:Amount}</td>\n                <td>{l:Receipt}</td>\n		    </tr>\n            <tr class=\"{ITEM_ODD_OR_EVEN}\" data-item-row=\"true\">\n                <td>\n                    {ITEM_PAYMENT_DATE}\n                </td>\n                <td>\n                    {ITEM_PAYMENT_METHOD}\n                </td>\n                <td>\n                    {ITEM_PAYMENT_DETAILS}\n                </td>\n                <td>\n                    {ITEM_PAYMENT_AMOUNT}\n                </td>\n                <td align=\"center\">\n                    <a href=\"{ITEM_PAYMENT_RECEIPT_URL}\" target=\"_blank\">{l:View Receipt}</a>\n                </td>\n            </tr>\n        </table>\n        ', 'a:0:{}', '0', 16, NULL, '2016-01-14', NULL),
(60, 'external_job', 'Used when displaying the external view of a job.', '{HEADER}<h2>Job Overview</h2>\nJob Name: <strong>{JOB_NAME}</strong> <br/>\n{PROJECT_TYPE} Name: <strong>{PROJECT_NAME}</strong> <br/>\n\n<br/>\n<h3>Task List: {TASK_PERCENT_COMPLETED}</h3> <br/>\n{TASK_LIST}\n<br/><br/>\n{JOB_INVOICES}\n', 'a:0:{}', '0', 1, NULL, '2016-05-16', NULL),
(61, 'external_template', 'Used when displaying the external content such as \"External Jobs\" and \"External Invoices\" and \"External Tickets\".', '<html>\n<head>\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <title>{PAGE_TITLE}</title>\n    {FAVICON}\n    {AUTOMATIC_STYLES}\n    {AUTOMATIC_SCRIPTS}\n    <style type=\"text/css\">\n        body{\n            margin:0;\n        }\n    </style>\n</head>\n<body>\n<div class=\"pretty_content_wrap\">\n    {CONTENT}\n</div>\n</body>\n</html>\n                ', 'a:5:{s:7:\"CONTENT\";s:17:\"The inner content\";s:10:\"PAGE_TITLE\";s:18:\"in the <title> tag\";s:7:\"FAVICON\";s:48:\"if the theme specifies a favicon it will be here\";s:16:\"AUTOMATIC_STYLES\";s:28:\"system generated stylesheets\";s:17:\"AUTOMATIC_SCRIPTS\";s:28:\"system generated javascripts\";}', '0', 1, 1, '2016-05-16', '2021-02-23'),
(62, 'absence_task_completion_email', 'Test email', '<h2>Job Task Completed</h2>\r\nWe thought you would like to know that your absence <strong>{ABSENCE_NAME}</strong> task <strong>{TASK_DESCRIPTION}</strong> has been completed.\r\n', 'a:0:{}', '1', 1, 1, '2016-06-06', '2020-05-17'),
(63, 'absence_staff_email', 'Assigned Job Tasks: {ABSENCE_NAME}', 'Dear {STAFF_NAME},<br>\n<br>\nPlease find below your {TASK_COUNT} assigned tasks for absence: {ABSENCE_NAME}.<br><br>\nYou can view this absence by <a href=\"{ABSENCE_URL}\">clicking here</a>.<br><br>\n{ABSENCE_TASKS}<br><br>\nThank you,<br><br>\n{FROM_NAME}\n', 'a:5:{s:10:\"STAFF_NAME\";s:14:\"Customers Name\";s:12:\"ABSENCE_NAME\";s:8:\"Job Name\";s:10:\"TASK_COUNT\";s:24:\"Number of assigned tasks\";s:11:\"ABSENCE_URL\";s:28:\"Link to absence for customer\";s:13:\"ABSENCE_TASKS\";s:45:\"Output of absence tasks for this staff member\";}', '1', 1, NULL, '2016-06-06', NULL),
(64, 'absence_task_approval', 'Job Task {APPROVED_OR_REJECTED}: {ABSENCE_NAME}', 'Dear {STAFF_NAME},<br>\n<br>\nThe task has been <strong>{APPROVED_OR_REJECTED}</strong> for the absence: {ABSENCE_NAME}.<br><br>\nThe absence can be viewed by <a href=\"{ABSENCE_URL}\">clicking here</a>.<br><br>\nJob Task: {ABSENCE_TASK}<br><br>\nMessage: {MESSAGE}<br><br>\nThank you,<br><br>\n{FROM_NAME}\n', 'a:5:{s:20:\"APPROVED_OR_REJECTED\";s:28:\"Will be Approved or Rejected\";s:12:\"ABSENCE_NAME\";s:8:\"Job Name\";s:11:\"ABSENCE_URL\";s:28:\"Link to absence for customer\";s:12:\"ABSENCE_TASK\";s:44:\"Output of absence task for this staff member\";s:7:\"MESSAGE\";s:28:\"Approved or Rejected message\";}', '1', 1, NULL, '2016-06-06', NULL);
