(67, 'refund_pdf', 'Used for printing out an refund for the customer.', '<html>\n					<head>\n					<title>Refund</title>\n					<meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n					<style type=\"text/css\">\n					body{\n					font-family:Helvetica, sans-serif;\n					padding:0;\n					margin:0;\n					}\n					td{\n					font-family:Helvetica, sans-serif;\n					padding:2px;\n					}\n					h3{\n					font-size: 22px;\n					font-weight: bold;\n					margin:10px 0 10px 0;\n					padding:0 0 5px 0;\n					border-bottom:1px solid #6f6f6f;\n					width:100%;\n					}\n					.style11 {\n					font-size: 24px;\n					font-weight: bold;\n					margin:0;\n					padding:0;\n					}\n					.task_header,\n					.task_header th{\n					background-color:#e8e8e8;\n					color: #6f6f6f;\n					font-weight: bold;\n					}\n					tr.odd{\n					background-color:#f9f9f9;\n					}\n					</style>\n					</head>\n					<body>\n					<table style=\"width: 100%;\" border=\"0\" cellspacing=\"0\" cellpadding=\"1\" align=\"center\">\n					<tbody>\n					<tr>\n					<td colspan=\"2\" align=\"left\" valign=\"top\"><img title=\"Logo\" src=\"http://ultimateclientmanager.com/images/logo_ucm.png\" alt=\"Logo\" width=\"202\" height=\"60\" /></td>\n					<td colspan=\"2\" align=\"left\" valign=\"top\"><span class=\"style11\">REFUND</span></td>\n					</tr>\n					<tr>\n					<td width=\"12%\">&nbsp;</td>\n					<td width=\"43%\">&nbsp;</td>\n					<td width=\"14%\">&nbsp;</td>\n					<td width=\"31%\">&nbsp;</td>\n					</tr>\n					<tr>\n					<td><strong>ABN:</strong></td>\n					<td>12 345 678 912</td>\n					<td><strong>Refund No: <br /> </strong></td>\n					<td>{REFUND_NUMBER}</td>\n					</tr>\n					<tr>\n					<td><strong>Email: </strong></td>\n					<td>your@company.com</td>\n					<td><strong>Issued Date:</strong></td>\n					<td>{DATE_CREATE}</td>\n					</tr>\n					<tr>\n					<td><strong>Web: </strong></td>\n					<td>www.company.com</td>\n					<td><strong>Valid Until:</strong></td>\n					<td>{DATE_CREATE+30d}</td>\n					</tr>\n					</tbody>\n					</table>\n					<h3>RECIPIENT</h3>\n					<table style=\"width: 100%;\" border=\"0\" cellspacing=\"0\" cellpadding=\"1\" align=\"center\">\n					<tbody>\n					<tr>\n					<td valign=\"top\" width=\"12%\"><strong>Company:</strong></td>\n					<td valign=\"top\" width=\"43%\">{CUSTOMER_NAME}</td>\n					<td valign=\"top\" width=\"14%\"><strong>Email:</strong></td>\n					<td valign=\"top\" width=\"31%\">{CONTACT_EMAIL}</td>\n					</tr>\n					<tr>\n					<td valign=\"top\"><strong>Contact:</strong></td>\n					<td valign=\"top\">{CONTACT_NAME}</td>\n					<td valign=\"top\"><strong>{PROJECT_TYPE}:</strong>&nbsp;</td>\n					<td valign=\"top\">{PROJECT_NAME}&nbsp;</td>\n					</tr>\n					<tr>\n					<td valign=\"top\"><strong>Phone:</strong></td>\n					<td valign=\"top\">{CONTACT_PHONE}</td>\n					<td valign=\"top\">&nbsp;</td>\n					<td valign=\"top\">&nbsp;</td>\n					</tr>\n					</tbody>\n					</table>\n					<h3>REFUND DETAILS</h3>\n					<div>{TASK_LIST}</div>\n					<p>&nbsp;</p>\n					<h3>REFUND APPROVAL</h3>\n					<p>{if:DATE_APPROVED}Thank you, this Refund was approved by <strong>{APPROVED_BY}</strong> on <strong>{DATE_APPROVED}</strong>{else} If you are happy with this refund please click the buttom below to process approval.</p>\n					<p><a href=\"{REFUND_LINK}\">Approve This Refund</a>{endif:DATE_APPROVED}</p>\n					</body>\n					</html>', 'a:0:{}', '1', 1, NULL, '2017-01-08', NULL),
(68, 'refund_email', 'Refund: {REFUND_NAME}', 'Dear {CUSTOMER_NAME},<br>\n					<br>\n					Please find attached details on your refund: {REFUND_NAME}.<br><br>\n					You can view and approve this refund online by <a href=\"{REFUND_URL}\">clicking here</a>.<br><br>\n					Thank you,<br><br>\n					{FROM_NAME}\n					', 'a:7:{s:13:\"CUSTOMER_NAME\";s:14:\"Customers Name\";s:11:\"REFUND_NAME\";s:11:\"Refund Name\";s:12:\"TOTAL_AMOUNT\";s:22:\"Total amount of refund\";s:16:\"TOTAL_AMOUNT_DUE\";s:43:\"Total amount of refund remaining to be paid\";s:9:\"FROM_NAME\";s:9:\"Your name\";s:10:\"REFUND_URL\";s:27:\"Link to refund for customer\";s:12:\"REFUND_TASKS\";s:45:\"Output of refund tasks similar to public link\";}', '1', 1, NULL, '2017-01-08', NULL),
(69, 'refund_staff_email', 'Assigned Refund Tasks: {REFUND_NAME}', 'Dear {STAFF_NAME},<br>\n					<br>\n					Please find below your {TASK_COUNT} assigned tasks for refund: {REFUND_NAME}.<br><br>\n					You can view this refund by <a href=\"{REFUND_URL}\">clicking here</a>.<br><br>\n					{REFUND_TASKS}<br><br>\n					Thank you,<br><br>\n					{FROM_NAME}\n					', 'a:5:{s:10:\"STAFF_NAME\";s:14:\"Customers Name\";s:11:\"REFUND_NAME\";s:11:\"Refund Name\";s:10:\"TASK_COUNT\";s:24:\"Number of assigned tasks\";s:10:\"REFUND_URL\";s:27:\"Link to refund for customer\";s:12:\"REFUND_TASKS\";s:44:\"Output of refund tasks for this staff member\";}', '1', 1, NULL, '2017-01-08', NULL),
(70, 'refund_approved_email', 'Refund Approved: {REFUND_NAME}', 'Dear {TO_NAME},<br>\n					<br>\n					This Refund has been approved: {REFUND_NAME}.<br><br>\n					This Refund was approved by <strong>{APPROVED_BY}</strong> on <strong>{DATE_APPROVED}</strong>\n					You can view this refund by <a href=\"{REFUND_URL}\">clicking here</a>.<br><br>\n					Thank you,<br><br>\n					{FROM_NAME}\n					', 'a:2:{s:11:\"REFUND_NAME\";s:11:\"Refund Name\";s:10:\"REFUND_URL\";s:27:\"Link to refund for customer\";}', '1', 1, NULL, '2017-01-08', NULL),
