(81, 'sms_vommande_confirmation', 'Confirmation de prise en charge par SMS', '<p>Bonjour {NAME_CUSTOMER},</p>\r\n<p>Felicitation, votre Commande vient d\'&ecirc;tre valider.</p>\r\n<p>Cordialement,</p>', 'a:5:{s:14:\"DATE_DEBUT_FIN\";s:24:\"20/08/2018 au 05/10/2018\";s:13:\"NAME_CUSTOMER\";s:7:\"Mohamed\";s:4:\"LINK\";s:24:\"https://rebrand.ly/ss2cx\";s:12:\"COMPANY_NAME\";s:5:\"DELTA\";s:13:\"CUSTOMER_NAME\";s:4:\"TAKI\";}', '1', 1, 1, '2018-06-28', '2019-04-30'),
