(87, 'sms_signature_client', 'Envoyer le lien pour la signature au client', '<p>Bonjour {NAME_CUSTOMER},</p>\r\n<p>Afin de finaliser votre dossier de formation, veuillez cliquer sur le lien suivant: {LINK}.</p>\r\n<p>Cordialement.</p>', 'a:2:{s:13:\"NAME_CUSTOMER\";s:0:\"\";s:4:\"LINK\";s:4:\"link\";}', '1', 1, 2701, '2018-08-26', '2019-04-19'),
(88, 'facturation_task_completion_email', 'Job Task Completed: {FACTURATION_NAME}.', '<h2>Job Task Completed</h2>\r\nWe thought you would like to know that your facturation <strong>{FACTURATION_NAME}</strong> task <strong>{TASK_DESCRIPTION}</strong> has been completed.\r\n', 'a:0:{}', '0', 1, NULL, '2018-09-16', NULL),
(89, 'facturation_staff_email', 'Assigned Job Tasks: {FACTURATION_NAME}', 'Dear {STAFF_NAME},<br>\r\n<br>\r\nPlease find below your {TASK_COUNT} assigned tasks for facturation: {FACTURATION_NAME}.<br><br>\r\nYou can view this facturation by <a href=\"{FACTURATION_URL}\">clicking here</a>.<br><br>\r\n{FACTURATION_TASKS}<br><br>\r\nThank you,<br><br>\r\n{FROM_NAME}\r\n', 'a:5:{s:10:\"STAFF_NAME\";s:14:\"Customers Name\";s:16:\"FACTURATION_NAME\";s:8:\"Job Name\";s:10:\"TASK_COUNT\";s:24:\"Number of assigned tasks\";s:15:\"FACTURATION_URL\";s:32:\"Link to facturation for customer\";s:17:\"FACTURATION_TASKS\";s:49:\"Output of facturation tasks for this staff member\";}', '1', 1, NULL, '2018-09-16', NULL),
(90, 'facturation_task_approval', 'Job Task {APPROVED_OR_REJECTED}: {FACTURATION_NAME}', 'Dear {STAFF_NAME},<br>\r\n<br>\r\nThe task has been <strong>{APPROVED_OR_REJECTED}</strong> for the facturation: {FACTURATION_NAME}.<br><br>\r\nThe facturation can be viewed by <a href=\"{FACTURATION_URL}\">clicking here</a>.<br><br>\r\nJob Task: {FACTURATION_TASK}<br><br>\r\nMessage: {MESSAGE}<br><br>\r\nThank you,<br><br>\r\n{FROM_NAME}\r\n', 'a:5:{s:20:\"APPROVED_OR_REJECTED\";s:28:\"Will be Approved or Rejected\";s:16:\"FACTURATION_NAME\";s:8:\"Job Name\";s:15:\"FACTURATION_URL\";s:32:\"Link to facturation for customer\";s:16:\"FACTURATION_TASK\";s:48:\"Output of facturation task for this staff member\";s:7:\"MESSAGE\";s:28:\"Approved or Rejected message\";}', '1', 1, NULL, '2018-09-16', NULL),
(91, 'sms_session_envoyer', 'SMS Envoyer lors d\'une session de formation', '<p>Bonjour {NAME_CUSTOMER}, Pour information, votre formation aura lieu du {DATE_DEBUT_FIN}. Cdt</p>', 'a:3:{s:13:\"NAME_CUSTOMER\";s:5:\"Ahmed\";s:14:\"DATE_DEBUT_FIN\";s:24:\"09/10/2018 au 31/10/2018\";s:12:\"COMPANY_NAME\";s:20:\"DELTA SUD FORMATION \";}', '1', 1, 1, '2018-10-09', '2019-03-30'),
