(104, 'invoice_fournisseur_print_basic', 'Alternative template for printing out an invoice_fournisseur for the customer.', '<html>\n<head>\n    <title>Invoice_fournisseur</title>\n    <style>\n        *\n        {\n            margin:0;\n            padding:0;\n            font-family:Arial;\n            font-size:10pt;\n            color:#000;\n        }\n        body\n        {\n            width:100%;\n            font-family:Arial;\n            font-size:10pt;\n            margin:0;\n            padding:0;\n        }\n\n        p\n        {\n            margin:0;\n            padding:0;\n        }\n\n        #wrapper\n        {\n            width:auto;\n            margin:0 15mm;\n        }\n\n        .page\n        {\n            page-break-after:always;\n        }\n\n        table\n        {\n            border-left: 1px solid #ccc;\n            border-top: 1px solid #ccc;\n	        width:100%;\n            border-spacing:0;\n            border-collapse: collapse;\n\n        }\n\n        table td\n        {\n            border-right: 1px solid #ccc;\n            border-bottom: 1px solid #ccc;\n            padding: 2mm;\n        }\n\n        table.heading\n        {\n            height:50mm;\n        }\n\n        h1.heading\n        {\n            font-size:14pt;\n            color:#000;\n            font-weight:normal;\n        }\n\n        h2.heading\n        {\n            font-size:9pt;\n            color:#000;\n            font-weight:normal;\n        }\n\n        hr\n        {\n            color:#ccc;\n            background:#ccc;\n        }\n\n        #invoice_fournisseur_body\n        {\n        }\n\n        #invoice_fournisseur_body , #invoice_fournisseur_total\n        {\n            width:100%;\n        }\n        #invoice_fournisseur_body table , #invoice_fournisseur_total table\n        {\n            width:100%;\n            border-left: 1px solid #ccc;\n            border-top: 1px solid #ccc;\n\n            border-spacing:0;\n            border-collapse: collapse;\n\n            margin-top:5mm;\n        }\n\n        #invoice_fournisseur_body table td , #invoice_fournisseur_total table td\n        {\n            text-align:center;\n            font-size:9pt;\n            border-right: 1px solid #ccc;\n            border-bottom: 1px solid #ccc;\n            padding:2mm 0;\n        }\n\n        #invoice_fournisseur_body table td.mono  , #invoice_fournisseur_total table td.mono\n        {\n            font-family:monospace;\n            text-align:right;\n            padding-right:3mm;\n            font-size:10pt;\n        }\n\n        #footer\n        {\n            width:auto;\n            margin:0 15mm;\n            padding-bottom:3mm;\n        }\n        #footer table\n        {\n            width:100%;\n            border-left: 1px solid #ccc;\n            border-top: 1px solid #ccc;\n\n            background:#eee;\n\n            border-spacing:0;\n            border-collapse: collapse;\n        }\n        #footer table td\n        {\n            width:25%;\n            text-align:center;\n            font-size:9pt;\n            border-right: 1px solid #ccc;\n            border-bottom: 1px solid #ccc;\n        }\n    </style>\n</head>\n<body>\n<div id=\"wrapper\">\n\n    <p style=\"text-align:center; font-weight:bold; padding-top:5mm;\">TAX INVOICE_FOURNISSEUR</p>\n    <br />\n    <table class=\"heading\" style=\"width:100%;\">\n        <tr>\n            <td style=\"width:80mm;\">\n                <h1 class=\"heading\">Your Company Here</h1>\n                <h2 class=\"heading\">\n                    Your Address Here<br />\n                    Your Address Here<br />\n                    Your Address Here<br />\n\n                    Website : www.website.com<br />\n                    E-mail : info@website.com<br />\n                    Phone : +1 - 123456789\n                </h2>\n            </td>\n            <td rowspan=\"2\" valign=\"top\" align=\"right\" style=\"padding:3mm;\">\n                <table>\n                    <tr><td>Invoice_fournisseur No : </td><td>{INVOICE_FOURNISSEUR_NUMBER}</td></tr>\n                    <tr><td>Invoice_fournisseur Date : </td><td>{DATE_CREATE}</td></tr>\n                    <tr><td>Due Date : </td><td>{DATE_DUE}</td></tr>\n                    <tr><td>Paid Date : </td><td>{DATE_PAID}</td></tr>\n                </table>\n            </td>\n        </tr>\n        <tr>\n            <td>\n                <b>Buyer</b> :<br />\n                {CUSTOMER_NAME}<br />\n                {CUSTOMER_ADDRESS}<br/>\n	            {CUSTOMER_PHONE}<br/>\n	            {CUSTOMER_EMAIL}\n            </td>\n        </tr>\n    </table>\n\n\n    <div id=\"content\">\n\n        <div id=\"invoice_fournisseur_body\">\n	            {TASK_LIST}\n        </div>\n\n        <table style=\"width:100%; \">\n            <tr>\n                <td valign=\"top\">\n                    {PAYMENT_METHODS}<br/>\n	                {PAYMENT_HISTORY}\n                </td>\n            </tr>\n        </table>\n    </div>\n\n    <br />\n\n    </div>\n\n    <htmlpagefooter name=\"footer\">\n        <hr />\n        <div id=\"footer\">\n            <table>\n                <tr><td>Software Solutions</td><td>Mobile Solutions</td><td>Web Solutions</td></tr>\n            </table>\n        </div>\n    </htmlpagefooter>\n    <sethtmlpagefooter name=\"footer\" value=\"on\" />\n\n</body>\n</html>', 'a:0:{}', '1', 1, NULL, '2019-10-11', NULL);
