eacute;glementaires et relationnelles avec une formation 100% digitale.</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">&nbsp;</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">Votre charg&eacute;e de formation City One vous enverra vos codes Butterfly et chez DMM nous vous connecterons&nbsp; &agrave; notre plateforme FOAD !</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">&nbsp;</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">Nous sommes ravis de pouvoir vous accompagner quelques semaines dans cette aventure.</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">&nbsp;</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">Pour b&eacute;n&eacute;ficier de cette formation, rejoignez notre plateforme d&rsquo;inscription en cliquant sur le lien ci-dessous :&nbsp;</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\"><span>{LIEN_INVIATION}</span></p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">&nbsp;</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">La proc&eacute;dure d&rsquo;inscription se fait uniquement en quelques clics.&nbsp;</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">&nbsp;</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">Les technologies &eacute;voluent, la formation aussi !</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">&nbsp;</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">Nous avons mis en place pour vous plusieurs technologies p&eacute;dagogiques : e-learning et micro-doing, vous allez vous sentir plus qu&rsquo;acteur de vos formations !</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; ms