eight-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\"><span>{LIEN_INVIATION}</span></p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">&nbsp;</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">La proc&eacute;dure d&rsquo;inscription se fait uniquement en quelques clics.&nbsp;</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">&nbsp;</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">Les technologies &eacute;voluent, la formation aussi !</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">&nbsp;</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">Nous avons mis en place pour vous plusieurs technologies p&eacute;dagogiques : e-learning et micro-doing, vous allez vous sentir plus qu&rsquo;acteur de vos formations !</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">&nbsp;</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">Nous esp&eacute;rons vous compter dans l&rsquo;&eacute;quipe et vous retrouver tr&egrave;s bient&ocirc;t.&nbsp;</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">&nbsp;</p>\r\n<p style=\"margin: 0; -webkit-text-size-adjust: none; -ms-text-size-adjust: none; mso-line-height-rule: exactly; font-size: 14px; font-family: arial, \'helvetica neue\', helvetica, sans-serif; line-height: 21px; color: #333333;\">Equipe DMM</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"es-footer\" style=\"mso-table-lspace: 0pt; mso-table-rspace: 0pt; border-collapse: collapse; border-spacing: 0px; table-layout: fixed !important; width: 100%; background-color: transparent; background-repeat: repeat; background-position: center top;\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr style=\"border-collapse: collapse;\">\r\n<td style=\"padding: 0; margin: 0;\" align=\"center\">\r\n<table class=\"es-footer-body\" style=\"border-collapse: collapse; border-spacing: 0px; background-color: transparent; width: 600px;\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr style=\"border-collapse: collapse;\">\r\n<td style=\"margin: 0; padding: 20px;\" align=\"left\">\r\n<table style=\"border-collapse: collapse; border-spacing: 